  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the Hawaiian
  Islands National Wildlife Refuge summarizes Refuge activities and accomplishments
  during the 1969 calendar year. The report begins with an introduction to the Refuge.
  Management and enforcement are discussed next. The Division of Wildlife Services
  and the River Basin Studies are also covered. Wildlife research and endangered species
  programs are outlined. The wildlife section of the report covers migratory birds,
  fish, and reptiles. Physical developments, collections, and vegetation control are
  discussed in the Refuge development and maintenance section. Resource management
  is outlined as well as field investigations. The public relations section covers
  recreational uses of the Refuge, Refuge visitors, Refuge participation, and safety.
  An article from the January, 1970 edition of Audubon is attached.\",\n\t\"license_title\":
